import styled from "styled-components";
import styles from "./Body.module.css"
function Body2({content, content2, onClick}){
    const ImgWraper = styled.div`
    width: 100vw;
    height: 100vh;
    object-fit: cover;
    color: white;
`
    return(
        <>
        {(content || onClick && content2) && (<>
            <ImgWraper> 
                안녕하세요
            </ImgWraper>
            <div className={styles.pos}>
                <h1>신입 프론트개발자를 희망하는 전준희 입니다. 잘 부탁드립니다.</h1>
            </div>
        </>) }
       
        </>
    )
}

export default Body2;
